import React from 'react';
import {Link} from 'react-router-dom';

const Toolbar = () => {
    return (
        <div className="main-toolbar">
        <div className="toolbar d-flex align-items-center gap-3 margin-top-5 ">
            <Link to="/gallery">Products page</Link>
            <Link to="/profile">Cart page</Link>
        </div>
        </div>
    )
}

export default Toolbar;
